#include<iostream>
#include<vector>
using namespace std;
int jump(vector<int>& nums) {
	int len = nums.size();
	if (len <= 1)
		return 0;
	int times = 0, start = 0;
	while (start<len)
	{
		int n = nums[start];
		if (start + n >= len - 1)
		{
			times++;
			return times;
		}
		int cur = 0, step = 0;
		for (int i = 1; i <= n; i++)
		{
			if (i + nums[start + i]>cur)
			{
				cur = i + nums[start + i];
				step = i;
			}
		}
		start = start + step;
		times++;
	}
	return times;
}
